import React from 'react'

import axios from 'axios'

import { Formik, Field, Form } from 'formik'

const ComplexInformations = (props) => {

    return (
        <>
            <Formik
                initialValues={{
                    complex_informations: {
                        complex_name: '',
                        house_number: '',
                        city: '',
                        postal_code: '',
                        phone_number: '',
                        email: '',
                        street: '',
                        house_number_extension: '',
                        country: '',
                        phone_number_landcode: '',
                        opening_hours: '',
                        facility_types: []
                    }
                }}
                onSubmit={( data ) => {
                    console.log(data)
                    /* const res = axios.post('http://10.0.4.5:8000/api/v1/vhe/registerintroduction/', data)
                    res.then(res => { console.log('res', res) }).catch( error => { console.log(error) }) */
                    props.next(data)
                }}
            >
            {({
                values,
                handleChange,
                handleBlur
            }) => (
                <Form>
                    <p>First name</p>
                    <Field name='complex_informations.complex_name'/>

                    <p>House number</p>
                    <Field name='complex_informations.house_number'/>

                    <p>City</p>
                    <Field name='complex_informations.city'/>

                    <p>Postal code</p>
                    <Field name='complex_informations.postal_code'/>

                    <p>Phone number</p>
                    <Field name='complex_informations.phone_number'/>

                    <p>Email</p>
                    <Field name='complex_informations.email'/>

                    <p>Street</p>
                    <Field name='complex_informations.street'/>

                    <p>House number extension</p>
                    <Field name='complex_informations.house_number_extension'/>

                    <label htmlFor='complex_informations.country' style={{ display: 'block' }}>
                        Country
                    </label>
                    <select
                        name='complex_informations.country'
                        value={values.complex_informations.country}
                        onChange={handleChange}
                        onBlur={handleBlur}
                        style={{ display: 'block' }}
                    >
                        <option value='' label='Select a country' />
                        {country__array.map((item, index) => (
                            <option key={index} value={item.value} label={item.label} />
                        ))}
                    </select>

                    <label htmlFor='complex_informations.phone_number_landcode' style={{ display: 'block' }}>
                        Phone number landcode
                    </label>
                    <select
                        name='complex_informations.phone_number_landcode'
                        value={values.complex_informations.phone_number_landcode}
                        onChange={handleChange}
                        onBlur={handleBlur}
                        style={{ display: 'block' }}
                    >
                        <option value='' label='Select a phone number landcode' />
                        {country__array.map((item, index) => (
                            <option key={index} value={item.value} label={item.label} />
                        ))}
                    </select>


          <div id="checkbox-group">Checked</div>
          <div role="group" aria-labelledby="checkbox-group">
            <label>
              <Field type="checkbox" name="checked" value="One" />
              One
            </label>
            <label>
              <Field type="checkbox" name="checked" value="Two" />
              Two
            </label>
            <label>
              <Field type="checkbox" name="checked" value="Three" />
              Three
            </label>
          </div>

                    <div>Facilities types</div>
                    <div>
                        {facilityTypes__array.map((item, index) => (
                            <label key={index}>
                                <Field type='checkbox' name={'complex_informations.facility_types.' + item.value} />
                                    {item.label}
                            </label>
                        ))}
                    </div>

                    <button type='submit'>Submit</button>
                </Form>
            )}
            </Formik>
        </>
    )
}

